15. 다음 코드에서 @property와 @age.setter를 사용한 age 속성의 동작을 해석하세요.

class Student:
    def __init__(self, age):
        self._age = age

    @property
    def age(self):
        return self._age

    @age.setter
    def age(self, value):
        if not isinstance(value, int) or value < 0:
            raise ValueError("Age must be a non-negative integer")
        self._age = value
